const ItemsList = () => {
  return (
    <div>
      {DUMMY_MEALS.map((meal) => (
        <Items
          key={meal.id}
          id={meal.id}
          name={meal.name}
          description={meal.description}
          price={meal.price}
          image={meal.image}
        />
      ))}
    </div>
  );
};

export default ItemsList;
